/**
 * Dynamically generates inline SVG for icons
 *
 * SVG content from icomoon.io
 * Every icon will have a class bearing its name
 * Icon paths are listed above
 */

const Icon = ({ icon, size, classes, ...rest }) => {
  const iconClass = classNames('icon', `${icon}`, classes);
  return (
    <svg
      height={`${size}px`}
      width={`${size}px`}
      className={iconClass}
      viewBox="0 0 32 32"
    >
      <path d={icons[icon]} />
    </svg>
  );
};

Icon.propTypes = {
  icon: PropTypes.string.isRequired,
  size: PropTypes.number.isRequired,
  classes: PropTypes.oneOfType([PropTypes.string, PropTypes.object])
};

Icon.defaultProps = {
  size: 20
};

export default Icon;
